import React from 'react';

import space from '../../assets/images/space.jpg'

const image = ( props ) =>{
    const image_path = String(props.imagePath)
    return(
        <div>
            <img src={require(image_path)} height='500px' width='500px' alt='BIRD'></img>
            <img src={require('../../assets/images/space.jpg')} height='500px' width='500px' alt='BIRD'></img>
        </div>
    )
}

export default image;
